import React from 'react';
import Channel from './Channel.js'

export default function ChannelsList({ channels, channelSelect }) {
    function handleChannelClick(idx) {
        console.log(idx)
        channelSelect();
    }
    return (
        <div className="div__channel">
            {channels.map((channel, idx) => {
                return <Channel key={idx} channel={channel} onClick={this.handleChannelClick(idx)} />
            })}
        </div>
    )
}
